Pesquisa realizada em municípios do Estado de Goias representando todas as regiões do Estado, com 6000 entrevistas. A margem de erro é de 1.3% para mais ou para menos e o índice de confiança é de 95%. O plano amostral consta de quotas proporcionais as existentes no universo de acordo com as variáveis, Região, Sexo, Faixa Etária. Escolaridade e Renda Familiar não são controladas nas quotas. Variável quanto a REGIÃO: proporcional ao setor censitário do IBGE. Faz-se o resultado após a coleta quanto, a FAIXA ETÁRIA: 16 a 24 anos 14,3%; 25 a 34 anos 20,8%; 35 a 44 anos 21,1%; 45 a 59 anos 25,4%; 60 anos ou mais 18,4%;SEXO: masculino 47,5% e feminino 52,5%;Variável quanto a ESCOLARIDADE:ANALFABETO/LÊ E ESCREVE	8,9%;
ENSINO FUNDAMENTAL INCOMPLETO	22,2%;ENSINO FUNDAMENTAL COMPLETO	6,0%;ENSINO MÉDIO INCOMPLETO	16,1%;ENSINO MÉDIO COMPLETO	28,3%;SUPERIOR INCOMPLETO	6,8%;SUPERIOR COMPLETO	11,7%;
quanto a RENDA FAMILIAR: ATÉ 01 SALÁRIO MINIMO, 18,6%, DE 1 A 02 SALARIOS MINIMOS, 24,4%, DE 2 A 05 SALARIOS MINIMOS, 36,6%, DE 05 SALÁRIOS OU MAIS, 20,4%. 

FONTE DOS DADOS: https://sidra.ibge.gov.br/tabela/3268 https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/consulta-quantitativo https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/estatistica-do-eleitorado-por-sexo-e-faixa-etaria https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/estatistica-do-eleitorado-por-sexo-e-grau-de-instrucao https://praticaclinica.com.br/anexos/ccolaborativa-calculo-amostral/ccolaborativa-calculo-amostral.php

"A amostra será representativa do eleitorado da área pesquisada e será selecionada em três etapas. Na primeira etapa realiza-se um sorteio probabilístico dos municípios onde as entrevistas serão realizadas através do método PPT (Probabilidade Proporcional ao Tamanho), considerando a população eleitora com 16 anos ou mais residente nos municípios como base para essa seleção. Na segunda etapa, faz-se um sorteio probabilístico das localidades, onde as entrevistas serão realizadas, através do método PPT (Probabilidade Proporcional ao Tamanho), tomando a população eleitora de 16 anos ou mais residente nas localidades como base para essa seleção. Na terceira etapa, a seleção do entrevistado dentro da localidade, será feita utilizando-se quotas amostrais proporcionais, em função das seguintes variáveis:
GÊNERO:
Masculino - 47%;
Feminino - 53% |
FAIXA ETÁRIA:
Entre 16 e 24 anos: 14%;
Entre 25 e 34 anos: 21%;
Entre 35 e 44 anos: 21%;
Entre 45 e 59 anos: 25%;
Com 60 anos ou mais: 19% |
ESCOLARIDADE:
De analfabeto até ensino fundamental completo: 37%;
Ensino médio incompleto ou completo: 44%
Ensino superior incompleto ou completo: 19% |
RENDA DOMICILIAR MENSAL:
Sem rendimentos até 2 salários mínimos: 43%
Mais de 2 a 5 salários mínimos: 37%
Mais de 5 salários mínimos: 20%
Está prevista eventual ponderação para correção das variáveis gênero e faixa etária, com base nos percentuais acima apresentados, caso ocorram diferenças superiores a 3,0 (três) pontos percentuais entre o previsto na amostra e a coleta realizada, para as variáveis escolaridade e  renda domiciliar mensal, o fator de ponderação é igual a 1, (resultados obtidos no campo). O nível de confiança estimado é de 95% (noventa e cinco por cento) para uma margem de erro estimada, considerando uma técnica de amostragem aleatória simples, de aproximadamente 2,5 (dois vírgula cinco) pontos percentuais para mais ou para menos sobre os resultados obtidos. Fonte de Dados: IBGE Censo 2010 e TSE - Agosto 2022."

