Pesquisa realizada no município de IPAMERI - GO, com 440 entrevistas. A margem de erro é de 4,5% para mais ou para menos e o índice de confiança é de 95%. O plano amostral consta de quotas proporcionais as existentes no universo de acordo com as variáveis, Região, Sexo, Faixa Etária. Escolaridade e Renda Familiar não são controladas nas quotas. Variável quanto a REGIÃO: proporcional ao setor censitário do IBGE. 
Faz-se o resultado após a coleta quanto, a FAIXA ETÁRIA: 16 a 24 anos 12,9%; 25 a 34 anos 18,9%; 
35 a 44 anos 19,3%; 45 a 59 anos 26,2%; 60 anos ou mais 22,7%; 

SEXO: masculino 48,6% e feminino 51,4%; 

Variável quanto a ESCOLARIDADE: 
ANALFABETO/LÊ E ESCREVE	12,0%; 
ENSINO FUNDAMENTAL INCOMPLETO	27,2%; 
ENSINO FUNDAMENTAL COMPLETO	6,4%; 
ENSINO MÉDIO INCOMPLETO	14,7%; 
ENSINO MÉDIO COMPLETO	22,7%; 
SUPERIOR INCOMPLETO	5,5%; 
SUPERIOR COMPLETO	11,5%.

quanto a RENDA FAMILIAR: ATÉ 01 SALÁRIO MINIMO, 22,1%, DE 1 A 02 SALARIOS MINIMOS, 28,1%, 
DE 2 A 05 SALARIOS MINIMOS, 34,6%, DE 05 SALÁRIOS OU MAIS, 15,2%. 

FONTE DOS DADOS: https://sidra.ibge.gov.br/tabela/3268 https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/consulta-quantitativo https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/estatistica-do-eleitorado-por-sexo-e-faixa-etaria https://www.tse.jus.br/eleitor/estatisticas-de-eleitorado/estatistica-do-eleitorado-por-sexo-e-grau-de-instrucao https://praticaclinica.com.br/anexos/ccolaborativa-calculo-amostral/ccolaborativa-calculo-amostral.php
